import React, { memo } from 'react';
import { Search as SearchIcon } from '@mui/icons-material';
import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';

import { Container } from './styles';


interface Data {
  value: string,
  align: "left" | "center" | "right",
}

interface TableProps {
  className?: string;
  header: Data[],
  data: {
    data: {
      value: string,
      align: "left" | "center" | "right",
    }[],
    id: string,
  }[]
};

const TableBar = ({ className, header, data }: TableProps) => (
  <Container className={className}>
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            {header.map((hd: Data) => <TableCell align={hd.align}>{hd.value}</TableCell>)}
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow key={row.id}>
              {row.data.map((r: Data) => (
                <TableCell align={r.align}>{r.value}</TableCell>
              ))}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>

  </Container>
);

export default memo(TableBar);
